import { Accordion } from "react-accessible-accordion";

const Forecast = ({data}) => {
    return  (
    <>
         <label className="title">Daily</label>
         <Accordion allowZeroExpanded>
            {data.list.splice(0, 7).map}
            <AccordationItem></AccordationItem>
         </Accordion>
    </>
    )
}

export default Forecast;
